import React from 'react'
import dummy from '../resource/dummyData'
import './ContentList.css'

function ContentList() {
  return (
    <div className="row">
      {dummy.map((el)=>{
        console.log(el);
        <div className="row">
          {/* data의 번호 */}
          <div className="col"></div>
          {/* data의 제목 */}
          <div className="col"></div>
          {/* data의 작성일자 */}
          <div className="col"></div>
        </div>
        })
      }
    </div>
  )
}

export default ContentList
